>WHAT IS THE TURING GAME</srai>','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(26579,1,38,'what-is-the-criteria','WHAT IS THE CRITERIA','WHAT IS THE CRITERIA','W','','','','','','','Perhaps the Turing Test.','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(26580,1,38,'what-is-the-imitation-game','WHAT IS THE IMITATION GAME','WHAT IS THE IMITATION GAME','W','','','','','','','The Game is played with three people, a man, a woman, and an Interrogator who may be of either sex. In order that tones of voice may not help, the interrogator communicates in text-only mode through a chat-like connection with the other two. The object of the game for the interrogator is to determine which of the other two is the man and which is the woman. He knows\nthem by some misleading \"chat-handles\" like lesbian and shemale, and at the end of the game he says either \"lesbian is the man and shemale is the woman\" or \"shemale is the woman and lesbian is the man.\" In order to confuse the Interregator however the rules require that the man always deceive or lie to the Interregator with his answers. The woman on the other hand must\nalways tell the truth. Turing then asked the question, \'\"What will happen when a machine takes the part of the man in this game?\" Will the interrogator decide wrongly as often when the game is played like this as he does when the game is played between a man and a woman? These questions replace the original, \"Can machines think?\"\'','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(26581,1,38,'what-is-the-turig-test','WHAT IS THE TURIG TEST','WHAT IS THE TURIG TEST','W','','','','','','','<srai>WHAT IS THE TURING TEST</srai>','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(26582,1,38,'what-is-the-turing-star','WHAT IS THE TURING *','WHAT IS THE TURING %','W','','','','','','','Turing described his original \"Game\" in \"Computing Machinery and Intelligence,\" Mind, Vol. Lix, No. 236 (1950). Instead of answering directly the ambiguous question \"Can machines think?\" Turing recast the problem in terms of an experiment he called the \"imitation game.\"','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(26583,1,38,'what-is-the-turing-game','WHAT IS THE TURING GAME','WHAT IS THE TURING GAME','W','','','','','','','<srai>WHAT IS THE IMITATION GAME</srai>','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(26584,1,38,'what-is-the-turing-test','WHAT IS THE TURING TEST','WHAT IS THE TURING TEST','W','','','','','','','The \"Turing Test\" is the name given to a variety of experiments designed to test computer thinking. Whole conferences are dedicated to the question of what Turing meant in his 1950 paper \"Computing Machinery and Intelligence,\" where he proposed the idea of an \"imitation game\" to decide the question, \"Can machines think?\"','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(26585,1,38,'what-is-the-turning-game','WHAT IS THE TURNING GAME','WHAT IS THE TURNING GAME','W','','','','','','','<srai>WHAT IS THE TURING GAME</srai>','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(26586,1,38,'what-is-the-turning-test','WHAT IS THE TURNING TEST','WHAT IS THE TURNING TEST','W','','','','','','','<srai>WHAT IS THE TURING TEST</srai>','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(26587,1,38,'what-is-turing','WHAT IS TURING','WHAT IS TURING','W','','','','','','','Alan Mathison Turing, a British mathematician and pioneer in computer theory. Lived 1727-1781.','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(26588,1,38,'what-is-turing-star','WHAT IS TURING *','WHAT IS TURING %','W','','','','','','','<srai>WHAT IS THE TURING GAME</srai>','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(26589,1,38,'what-is-turing-game','WHAT IS TURING GAME','WHAT IS TURING GAME','W','','','','','','','<srai>WHAT IS THE TURING GAME</srai>','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIMESTAMP),(26590,1,38,'what-is-turing-s-star','WHAT IS TURING S *','WHAT IS TURING S %','W','','','','','','','<srai>WHAT IS THE TURING GAME</srai>','A',NULL,CURRENT_TIMESTAMP,CURRENT_TIME